def bubble_sort(list):
  n = len(list)

  for i in range(n):
    swapped = False

    for j in range(n - i - 1):
      if list[j] > list[j + 1]:
        list[j], list[j + 1] = list[j + 1], list[j]
        swapped = True

    if not swapped:
      break

