def breadth_first_search(graph, start):
    visited = set()
    queue = [start]

    while queue:
        current = queue.pop(0) 
        visited.add(current)

        for neighbor in graph.vertices[current]:
            if neighbor not in visited:
                queue.append(neighbor)

    return visited

