def sort_list(nums):
    """Sorts a list of numbers in ascending order using bubble sort."""

    n = len(nums)

    # Bubble sort algorithm
    for i in range(n):
        for j in range(0, n-i-1):
            if nums[j] > nums[j+1]:
                nums[j], nums[j+1] = nums[j+1], nums[j]

    return nums

