import re

def parse_text_file(file_path):
    """
    Parses a text file and returns a dictionary of 
    word counts.
    """

    word_counts = {}

    with open(file_path, 'r') as f:
        text = f.read()

    words = re.findall(r'\w+', text.lower())

    for word in words:
        if word in word_counts:
            word_counts[word] += 1
        else:
            word_counts[word] = 1

    return word_counts

