def is_prime(num):
    """
    Checks if a number is prime
    """
    if num <= 1:
        return False
    for i in range(2, int(num**0.5) + 1):
        if num % i == 0:
            return False
    return True


def get_primes(limit):
    """
    Generates prime numbers up to a given limit
    """
    primes = []
    for i in range(2, limit+1):
        if is_prime(i):
            primes.append(i)
    return primes

