def calculate_primes(limit):
    primes = []
    not_primes = set()

    for i in range(2, limit+1):
        if i not in not_primes:
            primes.append(i)
            for j in range(i*i, limit+1, i):
                not_primes.add(j)

    return primes

print(calculate_primes(100))

