def generate_name(length=8):
    """Generate a random name with given length"""

    vowels = 'aeiou'
    consonants = ''.join(set(string.ascii_lowercase) - set(vowels))

    name = ''
    for i in range(length):
        if i % 2 == 0:
            name += secrets.choice(consonants)
        else:
            name += secrets.choice(vowels)

    return name.title()

