def calculate_primes(n):
  numbers = [True for i in range(n+1)]
  p = 2
  while (p * p <= n):
    if (numbers[p] == True):
      for i in range(p * p, n+1, p):
        numbers[i] = False
    p += 1
  primes = []
  for p in range(2, n+1):
    if numbers[p]:
      primes.append(p)
  return primes

