def bubble_sort(nums):
  n = len(nums)

  for i in range(n):
    # Iterate through the unsorted part of the list
    for j in range(n-i-1):
      # Compare adjacent elements
      if nums[j] > nums[j+1]:
        # Swap elements if not in order
        nums[j], nums[j+1] = nums[j+1], nums[j]

  return nums

