def find_pythagorean_triple(limit):
  """Find a Pythagorean triple with sides less than limit."""
  for a in range(1, limit):
    for b in range(a, limit): 
      c_squared = a**2 + b**2
      c = int(c_squared**0.5)
      if c**2 == c_squared:
        return a, b, c
  return None

print(find_pythagorean_triple(100))

