    visit(maze, 0, 0)
    return maze

def visit(maze, x, y):
    maze[y][x] = 1

    directions = [(0, 1), (0, -1), (1, 0), (-1, 0)]
    random.shuffle(directions)

    for dx, dy in directions:
        nx, ny = x + dx, y + dy
        if 0 <= nx < len(maze[0]) and 0 <= ny < len(maze) and maze[ny][nx] == 0:
            maze[ny][nx] = 1
            visit(maze, nx, ny)

