        self.vertices[vertex2].add(vertex1) 

def traverse_breadth_first(graph, start):
    visited = set()
    queue = [start]

    while queue:
        current = queue.pop(0) 
        if current not in visited:
            visited.add(current)
            queue.extend(graph.vertices[current] - visited)

    return visited

