    with open(file_name, 'r') as csv_file:

        csv_reader = csv.reader(csv_file)

        headers = next(csv_reader)

        for line in csv_reader:

            dict_row = {}

            for i in range(len(headers)):

                dict_row[headers[i]] = line[i]

            results.append(dict_row)

    return results

