def print_file_contents(file_path):
    """Print the contents of a text file to the console."""
    if not os.path.isfile(file_path):
        print(f"Error: {file_path} does not exist or is not a file")
        return

    try:
        with open(file_path, 'r') as f:
            lines = f.readlines()
            for line in lines:
