import math

def flip_coin(num_flips):
    """Simulate flipping a coin multiple times."""
    outcomes = []
    for i in range(num_flips):
        if math.random() < 0.5:
            outcomes.append("Heads")
        else:
            outcomes.append("Tails")
    return outcomes

